import * as React from "react";
import { View, Text, StyleSheet } from "react-native";
import { Card, Title, Paragraph } from "react-native-paper";
import { DayEnum } from "../common/DayEnum";

export default function SujectDetails({ route }) {
  const { item } = route.params;
  console.log(route);
  return (
    <View style={styles.container}>
      <Card style={styles.card}>
        <Card.Content style={styles.card}>
          <Title style={styles.title}>Details of</Title>
          <Title style={styles.title}>{item.subject}</Title>
          <Paragraph>
            <Text style={styles.textBold}>Profesor name: </Text>
            {item.profesor}
          </Paragraph>
          <Paragraph>
            <Text style={styles.textBold}>Start Time: </Text>
            {item.startTime}
          </Paragraph>
          <Paragraph>
            <Text style={styles.textBold}>End adress: </Text>
            {item.endTime}
          </Paragraph>
          <Paragraph>
            <Text style={styles.textBold}>Day: </Text>
            {DayEnum[item.sheduleDay]}
          </Paragraph>
        </Card.Content>
      </Card>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    width: "100%",
    height: "100%",
    justifyContent: "center",
    backgroundColor: "#e3e3e3",
  },
  modal: {
    backgroundColor: "white",
    padding: 10,
    height: "50%",
  },
  modalText: {
    marginLeft: "auto",
    marginRight: "auto",
    fontSize: 20,
  },
  modalTextItemName: {
    marginLeft: "auto",
    marginRight: "auto",
    textAlign: "center",
    color: "#7d0633",
    fontSize: 35,
  },
  title: {
    textAlign: "center",
    marginBottom: 30,
  },
  textBold: {
    fontWeight: "bold",
  },
  chip: {
    marginLeft: "auto",
    marginRight: "auto",
    backgroundColor: "#006494",
  },
  activityIndicator: {
    width: "100%",
    height: "80%",
    justifyContent: "center",
  },
  buttonConfirm: {
    marginTop: 15,
    backgroundColor: "#7d0633",
    width: "100%",
  },
  snackbar: {
    backgroundColor: "#7d0633",
  },
});
